import React from 'react';
import { HeroContainer, HeroBackground } from './HeroElements';
import bg from '../../images/backgrounds/croco.jpg';

function index() {
    return (
        <HeroContainer id="home">
            <HeroBackground>
                 <div class="bg"/>
            </HeroBackground>
            <HeroContent>
                <HeroH5>Welcome to</HeroH5>
                <HeroH1>Croco-OS</HeroH1>
                <HeroH4>
                    Choose your desktop environment from
                            KDE, GNOME and i3wm.
                </HeroH4>
                <HeroBtnWrapper>
                    <HeroBtnDownload>
                        <h3>Download Croco-OS</h3>
                    </HeroBtnDownload>
                </HeroBtnWrapper>
            </HeroContent>
        </HeroContainer>
    )
}

export default index;
